import './App.css';
import React from "react";
import {BrowserRouter,useRoutes,Route} from "react-router-dom";
import Home from "./routes/Home";
import About from "./routes/About";

function App() {
  return (
    <BrowserRouter>
      <useRoutes>
        <Route path="/" element={Home} />
        <Route path="/about" element={About} />
      </useRoutes>
    </BrowserRouter>

  );
}

export default App;
